import { Trie } from '../../6_tree/前缀树trie/1_实现trie'

class WordTrie extends Trie {
  // 不如hashmap的写法
  searchWord(s: string, found = 0): boolean {
    if (s.length === 0) return found >= 2
    let node = this.root
    for (let i = 0; i < s.length; i++) {
      const c = s[i]
      if (node.children.has(c)) {
        node = node.children.get(c)!
        if (node.isWord && this.searchWord(s.slice(i + 1), found + 1)) return true
      } else return false
    }
    return false
  }
}

/**
 * @param {string[]} words
 * @return {string[]}
 * @description 返回 words 中的所有 连接词 。
 * 连接词 的定义为：一个字符串完全是由至少两个给定数组中的单词组成的。
 * @summary
 * 对于下面的极端用例会超时
 * 需要用trie
 * 把所有单词建成字典树，然后用DFS让每个单词在这课字典树上跑，看是否由多个单词组成
 */
const findAllConcatenatedWordsInADict = function (words: string[]): string[] {
  const res: string[] = []
  const trie = new WordTrie()

  for (const word of words) trie.insert(word)
  for (const word of words) {
    if (trie.search(word)) res.push(word)
  }

  return res
}

console.log(
  findAllConcatenatedWordsInADict([
    'cat',
    'cats',
    'catsdogcats',
    'dog',
    'dogcatsdog',
    'hippopotamuses',
    'rat',
    'ratcatdogcat',
  ])
)

// ["catsdogcats","dogcatsdog","ratcatdogcat"]

